const initialState = {
    name1: "",
    name2: ""
};

export const setName1 = name => ({
    type: "ADD_NAME_1",
    name
});

export const setName2 = name => ({
    type: "ADD_NAME_2",
    name
});

const reducer = (state = initialState, action="UNKNOWN") => {
    switch (action.type) {
        case "ADD_NAME_1":
            return action.name;
        case "ADD_NAME_2":
            return action.name;
        default:
            return state;
    }
};

export default reducer;
